import React, { useState } from 'react'

const Counter = (props) => {
    let [count,setCount]=useState(0)

    if(count>5){
        throw new Error;
    }
  return (
    <div>
        {count}<br/>
       <button onClick={()=>setCount(count+1)}>increment {props.title}</button>
    </div>
  )
}

export default Counter
